    class Program
    {
        static void Main(string[] args)
        {
            var builder = new ContainerBuilder();
            builder.RegisterType<ApplicationDbContext>().As<IEntityFrameworkContext>();
            builder.RegisterType<Mapper>().As<IMapper>();
            builder.RegisterType<Logger>().As<IEntityFrameworkLogService>();
            builder.RegisterType<PeopleRepostiory>().AsSelf();
            var container = builder.Build();

            var repo = container.Resolve<PeopleRepostiory>();

            //Generate(repo);

            Print(repo);
        }

        private static void Print(PeopleRepostiory repo)
        {
            var page = 1;
            var result = GetCollection<PersonViewModel>(repo, page, -1);
            Output(repo, result);
        }

